  // const hi = ;
  // console.log(hi)
  const ndata = {
    columns: data.columns,
    rows:data.rows.slice(0,nbins)
  }

  return (

    <MDBDataTable
      scrollY
      //scrollX
      maxHeight="200px"
      striped
      bordered
      small
      paging={false}
      data={ndata}
      searching={false}
    />
  );
}

export default DatatablePage;
